import React, { useState, useEffect } from "react";
import "./signup.css";
import axios from 'axios'

function ClassScheduleInput() {
  const [mon_A, setM1] = useState("");
  const [tue_A, setT1] = useState("");
  const [wed_A, setW1] = useState("");
  const [thu_a, setR1] = useState("");
  const [fri_A, setF1] = useState("");
  const [mon_D, setM2] = useState("");
  const [tue_D, setT2] = useState("");
  const [wed_D, setW2] = useState("");
  const [thu_D, setR2] = useState("");
  const [fri_D, setF2] = useState("");

  const [P_mon_A, setPM1] = useState("");
  const [P_tue_A, setPT1] = useState("");
  const [P_wed_A, setPW1] = useState("");
  const [P_thu_a, setPR1] = useState("");
  const [P_fri_A, setPF1] = useState("");
  const [P_mon_D, setPM2] = useState("");
  const [P_tue_D, setPT2] = useState("");
  const [P_wed_D, setPW2] = useState("");
  const [P_thu_D, setPR2] = useState("");
  const [P_fri_D, setPF2] = useState("");


  const [id, setId] = useState('');
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const fetchData = () => {
    axios.get(`http://localhost:8081/user/getSched/${id}`)
    .then(response => {
      const [mon_A, mon_D, tue_A, tue_D, wed_A, wed_D, thu_A, thu_D, fri_A, fri_D, Pmon_A, Pmon_D, Ptue_A, Ptue_D, Pwed_A, Pwed_D, Pthu_A, Pthu_D, Pfri_A, Pfri_D] = response.data;

      setM1(mon_A);
      setT1(tue_A);
      setW1(wed_A);
      setR1(thu_A);
      setF1(fri_A);

      setM2(mon_D);
      setT2(tue_D);
      setW2(wed_D);
      setR2(thu_D);
      setF2(fri_D);

      setPM1(Pmon_A);
      setPT1(Ptue_A);
      setPW1(Pwed_A);
      setPR1(Pthu_A);
      setPF1(Pfri_A);

      setPM2(Pmon_D);
      setPT2(Ptue_D);
      setPW2(Pwed_D);
      setPR2(Pthu_D);
      setPF2(Pfri_D);

      setError(null);
    })
    .catch(error => {
      setError(error.response ? error.response.data : error.message);
    });
  };

    const [clickedCell, setClickedCell] = useState(null);

    const handleButtonClick = (content) => {
        const shouldSayHi = window.confirm(`Are you sure you want to cancel ${content}?`);
        if (shouldSayHi) {
            setClickedCell(content);
        }
    };

    const renderCell = (content) => (
        content ? (
            <button onClick={() => handleButtonClick(content)}>
                {content}
            </button>
        ) : (
            <span>{content}</span>
        )
    );
  
  const m8 = "Ride with Reuben to UCLA";
  const m9 = "";
  const m10 = "";
  const m11 = "";
  const m12 = "";
  const m1 = "";
  const m2 = "";
  const m3 = "";
  const m4 = "";
  const m5 = "Ride Home with Jonah";
  const m6 = "";
  const m7 = "";
  const m8p = "";

  const t8 = "";
  const t9 = "";
  const t10 = "";
  const t11 = "";
  const t12 = "";
  const t1 = "";
  const t2 = "";
  const t3 = "";
  const t4 = "Ride Home with Jacob";
  const t5 = "";
  const t6 = "";
  const t7 = "Ride with Jonah To UCLA";
  const t8p = "";

  const w8 = "";
  const w9 = "";
  const w10 = "";
  const w11 = "";
  const w12 = "";
  const w1 = "";
  const w2 = "Ride with Jacob to UCLA";
  const w3 = "Ride Home with Ray";
  const w4 = "";
  const w5 = "";
  const w6 = "";
  const w7 = "";
  const w8p = "";

  const r8 = "";
  const r9 = "";
  const r10 = "";
  const r11 = "Ride with Ray to UCLA";
  const r12 = "";
  const r1 = "";
  const r2 = "";
  const r3 = "";
  const r4 = "";
  const r5 = "";
  const r6 = "Ride Home with Reuben";
  const r7 = "";
  const r8p = "";

  const f8 = "";
  const f9 = "";
  const f10 = "";
  const f11 = "";
  const f12 = "";
  const f1 = "Ride with Joshua to UCLA";
  const f2 = "";
  const f3 = "";
  const f4 = "";
  const f5 = "";
  const f6 = "";
  const f7 = "";
  const f8p = "Ride Home with Joshua";

  return (
    <div>
      <div>
      <label htmlFor="idInput">Enter ID:</label>
      <input
        type="text"
        id="idInput"
        value={id}
        onChange={(e) => setId(e.target.value)}
      />
      <button onClick={fetchData}>Fetch Data</button>

      <div>
        <h2>Mon_A: {mon_A}</h2>
        <h2>Mon_D: {mon_D}</h2>
        <h2>Tue_A: {tue_A}</h2>
        <h2>Tue_D: {tue_D}</h2>
        <h2>Everything else, including planned rides is returned. Look at schedule.jsx for implementation {P_mon_A}</h2>
      </div>

      {error && (
        <div>
          <h2>Error:</h2>
          <pre>{JSON.stringify(error, null, 2)}</pre>
        </div>
      )}
    </div>


      <h1>Schedule View Page</h1>
       <table border="22">
     <thead>
         <tr>
             <td></td>
             <th> Monday </th>
             <th> Tuesday </th>
             <th> Wednesday </th>
             <th> Thursday </th>
             <th> Friday </th>
         </tr>
     </thead>
     <tbody>
         <tr>
             <th>7:00-8:00</th>
             <td>{renderCell(m7)}</td>
             <td>{renderCell(t7)}</td>
             <td>{renderCell(w7)}</td>
             <td>{renderCell(r7)}</td>
             <td>{renderCell(f7)}</td>
         </tr>
         <tr>
             <th>8:00-9:00</th>
             <td>{renderCell(m8)}</td>
             <td>{renderCell(t8)}</td>
             <td>{renderCell(w8)}</td>
             <td>{renderCell(r8)}</td>
             <td>{renderCell(f8)}</td>
         </tr>
         <tr>
             <th>9:00-10:00</th>
             <td>{renderCell(m9)}</td>
             <td>{renderCell(t9)}</td>
             <td>{renderCell(w9)}</td>
             <td>{renderCell(r9)}</td>
             <td>{renderCell(f9)}</td>
         </tr>
         <tr>
             <th>10:00-11:00</th>
             <td>{renderCell(m10)}</td>
             <td>{renderCell(t10)}</td>
             <td>{renderCell(w10)}</td>
             <td>{renderCell(r10)}</td>
             <td>{renderCell(f10)}</td>
         </tr>
         <tr>
             <th>11:00-12:00</th>
             <td>{renderCell(m11)}</td>
             <td>{renderCell(t11)}</td>
             <td>{renderCell(w11)}</td>
             <td>{renderCell(r11)}</td>
             <td>{renderCell(f11)}</td>
         </tr>
         <tr>
             <th>12:00-1:00</th>
             <td>{renderCell(m12)}</td>
             <td>{renderCell(t12)}</td>
             <td>{renderCell(w12)}</td>
             <td>{renderCell(r12)}</td>
             <td>{renderCell(f12)}</td>
         </tr>
         <tr>
             <th>1:00-2:00</th>
             <td>{renderCell(m1)}</td>
             <td>{renderCell(t1)}</td>
             <td>{renderCell(w1)}</td>
             <td>{renderCell(r1)}</td>
             <td>{renderCell(f1)}</td>
         </tr>
         <tr>
             <th>2:00-3:00</th>
             <td>{renderCell(m2)}</td>
             <td>{renderCell(t2)}</td>
             <td>{renderCell(w2)}</td>
             <td>{renderCell(r2)}</td>
             <td>{renderCell(f2)}</td>
         </tr>
         <tr>
             <th>3:00-4:00</th>
             <td>{renderCell(m3)}</td>
             <td>{renderCell(t3)}</td>
             <td>{renderCell(w3)}</td>
             <td>{renderCell(r3)}</td>
             <td>{renderCell(f3)}</td>
         </tr>
         <tr>
             <th>4:00-5:00</th>
             <td>{renderCell(m4)}</td>
             <td>{renderCell(t4)}</td>
             <td>{renderCell(w4)}</td>
             <td>{renderCell(r4)}</td>
             <td>{renderCell(f4)}</td>
         </tr>
         <tr>
             <th>5:00-6:00</th>
             <td>{renderCell(m5)}</td>
             <td>{renderCell(t5)}</td>
             <td>{renderCell(w5)}</td>
             <td>{renderCell(r5)}</td>
             <td>{renderCell(f5)}</td>
         </tr>
         <tr>
             <th>6:00-7:00</th>
             <td>{renderCell(m6)}</td>
             <td>{renderCell(t6)}</td>
             <td>{renderCell(w6)}</td>
             <td>{renderCell(r6)}</td>
             <td>{renderCell(f6)}</td>
         </tr>
         <tr>
             <th>7:00-8:00</th>
             <td>{renderCell(m8p)}</td>
             <td>{renderCell(t8p)}</td>
             <td>{renderCell(w8p)}</td>
             <td>{renderCell(r8p)}</td>
             <td>{renderCell(f8p)}</td>
         </tr>
     </tbody>
 </table>
 {clickedCell && <div>{clickedCell} Canceled</div>}
    </div>
  );
}

export default ClassScheduleInput;
